import React from 'react'
import {PokemonCard} from './PokemonCard'

export const allCards = ({results}) =>{
    return(
        <div className = 'container'>
            <ul className = 'cards'>
                {
                    results.map(p=>{
                        <li className = 'card-item' key={p.name}>
                            <PokemonCard url={p.url}/>
                        </li>
                    })
                }
            </ul>
        </div>
    )
}
